using BackendProductApi.Dominio.Entidades;
using Microsoft.EntityFrameworkCore;
using System;
using System.Collections.Generic;
using System.Text;

namespace BackendProductApi.Infraestructura.Contexto
{
    public class ProductoContexto: DbContext
    {
        public ProductoContexto(DbContextOptions<ProductoContexto> option):base(option)
        {

        }

        public DbSet<Producto> Producto { get; set; }


        protected override void OnConfiguring(DbContextOptionsBuilder optionsBuilder)
        {
            base.OnConfiguring(optionsBuilder);
        }

