                entity.HasKey(e => e.ProductoId);

                entity.HasIndex(e => e.ProductoId);

                entity.Property(e => e.Nombre).HasColumnName("NOMBRE").HasColumnType("varchar(50)");

                entity.Property(e => e.Descripcion).HasColumnName("DESCRIPCION").HasColumnType("varchar(100)");

                entity.Property(e => e.Precio).HasColumnName("PRECIO").HasColumnType("decimal(5,2)");

                entity.Property(e => e.Categoria).HasColumnName("CATEGORIA").HasColumnType("varchar(100)");

                entity.Property(e => e.Imagen).HasColumnName("IMAGEN").HasColumnType("ntext");
                entity.HasData(new Producto() { ProductoId=1, Nombre = "Cubo de Rubik 2X2", Descripcion = "Puzle de Logica", Precio = 350M, Categoria = "Juegos", Imagen = "" });
